import React from 'react'
import PrimarySearchAppBar from '../config/components/appbar'
import Extra from '../config/components/extra'
import "../App.css";
import SMButton from "../config/components/button";
function Mainweb() {
  return (
    <>
      <PrimarySearchAppBar />
      <div className='div1'>
        <img className='imgmain' src={"https://cf.bstatic.com/xdata/images/hotel/max1024x768/257803292.jpg?k=78e57c0acabe8fdac0557960f051e755880276c4934436d58f1e8d26464c8ddc&o=&hp=1"} />
        {/* <SMButton className="book" label={"Book Now"}/> */}
        <div className='book'>
          <P></P>
          <button className='mainbtn'>Book Now</button>
        </div>
      </div>
      <Extra />
    </>
  )
}

export default Mainweb
